import React from 'react'

function TableHeader() {
    return (
        <thead>
          <tr>
            <th>File_Name</th>
            <th>Status</th>
          </tr>
        </thead>
    );  
}

function TableBody() {
    return (
        <tbody>
            <td>test</td>
            <td>test2</td>
        </tbody>
    );
}

function Table() {
    return (
        <table>
            <TableHeader />
            <TableBody />
        </table>
    );
}

export default Table;
